import React from "react";

export default function Contact() {
  return (
    <div className="p-8 text-chostoBrown">
      <h1 className="text-3xl font-bold mb-4">Contact Us</h1>
      <p>Phone: +91 98765 43210</p>
      <p>Email: contact@chosto.in</p>
    </div>
  );
}
